void setup() {
  Serial.begin(115200);
  
  illumi.begin();
  illumi.setBrightness(50);

  hp.begin();
  hp.setBrightness(50);

  pinMode(MODE_PIN, OUTPUT);
  digitalWrite(MODE_PIN, HIGH);

  pinMode(BPHASE_PIN, OUTPUT);
  pinMode(BPHASE_PIN, LOW);

  pinMode(BENABLE_PIN, OUTPUT);
  ledcSetup(BCHANNEL, 44100, 8);
  ledcAttachPin(BENABLE_PIN, BCHANNEL);

  pinMode(APHASE_PIN, OUTPUT);
  pinMode(APHASE_PIN, LOW);

  pinMode(AENABLE_PIN, OUTPUT);
  ledcSetup(ACHANNEL, 44100, 8);
  ledcAttachPin(AENABLE_PIN, ACHANNEL);

  irrecv.enableIRIn();

  PS4.begin();

  uint8_t bt_mac[6];
  esp_read_mac(bt_mac, ESP_MAC_BT);
  Serial.printf("Bluetooth Mac Address => %02X:%02X:%02X:%02X:%02X:%02X\r\n", bt_mac[0], bt_mac[1], bt_mac[2], bt_mac[3], bt_mac[4], bt_mac[5]);  

  Serial2.begin(115200);
}


void play(const unsigned char* ptr, uint32_t size)
{
    unsigned long int count = 0;
    while (count < raw_audio_len)
    {
        ledcWrite(BCHANNEL, ptr[count]);
        ets_delay_us(SAMPLE_DELAY_US);
        ++count;
    }
}


